import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
        <nav className="topic" id="toipc">
        <ul className="topicinside" id="topicinside">
          <li className="nametopic"><a href="/">Home</a></li>
          <li className="nametopic"><a href="/">String Method</a></li>
          <li className="nametopic" id="nametopic3"><a href="/">Textutils</a></li>
          <li className="nametopic"><a href="/">Array Method</a></li>
          <li className="nametopic"><a href="/">Help</a></li>
        </ul>
      </nav>
    )
  }
}
